import React from 'react';
import Comment from './Comment';

const CommentList = ({comments,displayComments}) => {
    return (
        <div key={comments.id}>
            {
                comments.map(comment=> <Comment key={comments.id} comment={comment}/>)
            }
        </div>

    );
};

export default CommentList;
